INSERT INTO `products` VALUES (1,1,'Green Hill wolf',1,'14 oz','Боксерские перчатки \"WOLF\" являются уникальным предложением на рынке. \r\n    Удлиненный манжет с плотным наполнителем обеспечивает повышенную защиту рук от ударов ногами. \r\n    Перчатки выполнены из натуральной кожи буйвола. Наполнитель - формованный пенополиуретан технологии Pre-SHAPE. \r\n    В перчатках применена технология \"ANTISHOCK SYSTEM\" для снижения риска травмы принимающего удар боксера. \r\n    Манжет на липучке.','черный',4500.00,'2021-03-18 17:10:21','2021-03-18 17:10:21'),(2,1,'Green Hill wolf',1,'12 oz','Боксерские перчатки \"WOLF\" являются уникальным предложением на рынке. \r\n    Удлиненный манжет с плотным наполнителем обеспечивает повышенную защиту рук от ударов ногами. \r\n    Перчатки выполнены из натуральной кожи буйвола. Наполнитель - формованный пенополиуретан технологии Pre-SHAPE. \r\n    В перчатках применена технология \"ANTISHOCK SYSTEM\" для снижения риска травмы принимающего удар боксера. \r\n    Манжет на липучке.','красный',4500.00,'2021-03-18 17:10:21','2021-03-18 17:10:21'),(3,1,'Green Hill wolf',1,'10 oz','Боксерские перчатки \"WOLF\" являются уникальным предложением на рынке. \r\n    Удлиненный манжет с плотным наполнителем обеспечивает повышенную защиту рук от ударов ногами. \r\n    Перчатки выполнены из натуральной кожи буйвола. Наполнитель - формованный пенополиуретан технологии Pre-SHAPE. \r\n    В перчатках применена технология \"ANTISHOCK SYSTEM\" для снижения риска травмы принимающего удар боксера. \r\n    Манжет на липучке.','синий',3500.00,'2021-03-18 17:10:21','2021-03-18 17:10:21'),(4,1,'Venum Elite',5,'12 oz','Боксерские перчатки Venum Elite. Боксёрские перчатки высокого класса, которые хорошо защищают руку их владельца. \r\n    Выполнены с учетом всех законов эргономики.\r\n    Идеально сочетание стиля и комфорта. Эти боксерские перчатки Venum были выбраны такими профессионалами своего дела как Вандерлей Силва, \r\n    Карлос Кондит, Лиото Мачида, Фрэнки Эдгар и многими другими.\r\n    Высококачественный наполнитель(пена) снижает силу удара, тем самым защищает кисть бойца и лицо его партнера.\r\n    Широкая застежка, обеспечивающая надежную фиксацию перчаток Venum на запястье. Так же застежка снабжена резиновой вставкой, для регулирования обхвата кисти.\r\n    Очень качественно сделанные швы.\r\n    Внешний материал перчаток для бокса Venum Elite - Premium Skintex leather.','черный',6000.00,'2021-03-18 17:10:21','2021-03-18 17:10:21'),(5,1,'Venum Elite',5,'14 oz','Боксерские перчатки Venum Elite. Боксёрские перчатки высокого класса, которые хорошо защищают руку их владельца. \r\n    Выполнены с учетом всех законов эргономики.\r\n    Идеально сочетание стиля и комфорта. Эти боксерские перчатки Venum были выбраны такими профессионалами своего дела как Вандерлей Силва, \r\n    Карлос Кондит, Лиото Мачида, Фрэнки Эдгар и многими другими.\r\n    Высококачественный наполнитель(пена) снижает силу удара, тем самым защищает кисть бойца и лицо его партнера.\r\n    Широкая застежка, обеспечивающая надежную фиксацию перчаток Venum на запястье. Так же застежка снабжена резиновой вставкой, для регулирования обхвата кисти.\r\n    Очень качественно сделанные швы.\r\n    Внешний материал перчаток для бокса Venum Elite - Premium Skintex leather.','белый',6000.00,'2021-03-18 17:10:21','2021-03-18 17:10:21'),(6,1,'Venum Elite',5,'12 oz','Боксерские перчатки Venum Elite. Боксёрские перчатки высокого класса, которые хорошо защищают руку их владельца. \r\n    Выполнены с учетом всех законов эргономики.\r\n    Идеально сочетание стиля и комфорта. Эти боксерские перчатки Venum были выбраны такими профессионалами своего дела как Вандерлей Силва, \r\n    Карлос Кондит, Лиото Мачида, Фрэнки Эдгар и многими другими.\r\n    Высококачественный наполнитель(пена) снижает силу удара, тем самым защищает кисть бойца и лицо его партнера.\r\n    Широкая застежка, обеспечивающая надежную фиксацию перчаток Venum на запястье. Так же застежка снабже