ro Style Elite Training Gloves — тренировочные боксёрские перчатки для спаррингов и работы на снарядах.\r\n    Изготовлены из качественной искусственной кожи с применением технологий Everlast, использующихся в экипировке профессиональных спортсменов.\r\n    Благодаря выверенной анатомической форме перчатки надёжно фиксируют руку и гарантируют защиту от травм. \r\n    Нижняя часть, полностью изготовленная из сетчатого материала, обеспечивает циркуляцию воздуха и препятствует образованию влаги, \r\n    а также неприятного запаха за счёт антибактериальной пропитки EVERFRESH. Комбинация лёгких дышащих материалов поддерживает оптимальную температуру тела.\r\n    Модель подходит для начинающих боксёров, которые хотят тренироваться с экипировкой высокого класса.','черный',2690.00,'2021-03-18 17:10:21','2021-03-18 17:10:21'),(18,1,'Everlast PU Pro',3,'12 oz','Высококачественная искусственная кожа совместно с  оптимальным дизайном обеспечивают износостойкость и функциональность перчаток.\r\n    Мелкая перфорация по всей ладони позволяет коже \"дышать\".\r\n    Антибактериальная пропитка убивает нехороший запах и бактерии.\r\n    Превосходно облегают кисть, следуя всем анатомическим изгибам ладони и предплечья.\r\n    Отличный вариант для начинающих спортсменов!','красный',2599.00,'2021-03-18 17:10:21','2021-03-18 17:10:21'),(19,1,'Перчатки BGV1',4,'12 oz','универсальные модель, которая идеально подходит для Кикбоксинга, Бокса и Муай Тай.\r\n    Прекрасно подойдут для тренировочных спаррингов, выступления на соревнованиях, работы на мешках и на лапах.\r\n    Перчатки ручной работы, выполнены из натуральной кожи.\r\n    Обладают хорошей амортизацией ударов за счет внутреннего наполнения пеной.','черный',10500.00,'2021-03-18 17:10:21','2021-03-18 17:10:21'),(20,2,'Перчатки снарядные на липучке',2,'M','Застёжка липучка гарантирует надёжное крепление на запястье. Закрытый большой палец.\r\n    Подкладка из влагоотводящей искусственной ткани. Натуральная кожа топового качества. Ру